function App() {



  const fruits = ['Banana', 'Maça', 'Laranja', 'Uva', 'Morango']

  const showFruits = true

  return(
    <div>
      <h1>Lista de frutas</h1>
      {
        showFruits && (
          <ul>
            {fruits.map((fruit, index)=>(
              <li key={index}>{fruit}</li>
            ))}
          </ul>
        )
      }
    </div>
  )
}



export default App;
